
yuvalsDirectives = angular.module('yuvalsDirectives', []);


yuvalsDirectives.directive("ybLoading", function($timeout) {
  return {
    replace: false,
    restrict: "EA",

    scope: {
      show: "=show",
      width: "@width",
      height: "@height",
      inPlace: "@inPlace"
    },    

    link: function(scope, elem, attr, ctrl) {
      var $elem = $(elem);
      var $div = $elem.find(".loadingIconDiv");
      var $img = $elem.find(".loadingIcon");

      if(scope.inPlace) {
        $div.removeAttr('style');
        $div.css('position', 'relative').css('top', '0px').css('left', '0px');
        $img.width(scope.width);
        $img.height(scope.height);
      }
      else {
        $(window).resize(function() {
          scope.poitionLoadingIndicator();
        });
      }

      scope.poitionLoadingIndicator = function() {
        var y = parseInt(($(window).height() - $div.outerHeight()) / 2);
        var x = parseInt(($(window).width() - $div.outerWidth()) / 2);
        $div.offset({top: y, left: x});
      }

      $timeout(function() {
        scope.poitionLoadingIndicator();
      }, 500);
    },

    template: 
      '<div class="loadingIconDiv" ng-show="show" style="position: fixed; opacity:0.5; top: -400px;">' +
        '<img class="loadingIcon" width="{{width}}" height="{{height}}" src="data:image/gif;base64," />'+
      '</div>'
  }
});



yuvalsDirectives.directive("ybGrid", function() {
  return {
    replace: false,
    restrict: "EA",
    template: '<canvas class="backcanvas" ng-init="init()" width="{{width}}" height="{{height}}"/>',

    scope: {
      width: "@width",
      height: "@height",
      drawCenter: "=drawCenter",
      loading: "=loading",
    },

    link: function($scope, element, attrs) {
      $scope.element = element;
      $scope.attrs = attrs;
      $scope.majorLineColor = "#bbb";
      $scope.minorLineColor = "#ddd";
      $scope.centerLineColor = "#f00";
      $scope.circleColor = "#6DAEDF";
      $scope.gridAlpha = .5

     $scope.$watch('loading', function() {
        $scope.drawGrid();
      });
    },

    controller: function($scope, $timeout) {
      $scope.init = function() {
        $timeout($scope.setCanvasDimensions);
        
        $(window).resize(function() {
          $scope.setCanvasDimensions();
        });       
      };
      
      $scope.setCanvasDimensions = function() {
        if($scope.canvas == null) {
          $scope.canvas =  $scope.element.find('canvas')[0];
        }
        
        $scope.canvas.width = window.innerWidth;
        $scope.canvas.height = window.innerHeight;
        //console.log("resize " + $scope.canvas.width + ":" + $scope.canvas.height);
        $scope.drawGrid();
      }
      
      $scope.drawGrid = function() {
        if($scope.canvas != undefined) {
          var ctx = $scope.canvas.getContext("2d");
          var w = $scope.canvas.width;
          var h = $scope.canvas.height;
          var x = 0.5;
          var y = 0.5; 
          var spacing = 10;
          var clr;
          var hLines = h / spacing;
          var vLines = w / spacing;
          var center = {"x" : w/2, "y" : h/2};

          ctx.clearRect(0, 0, w, h);
          ctx.lineWidth = 1;
          ctx.globalAlpha = $scope.gridAlpha;
          
          //draw the vertical lines
          for(var v = 0; v < vLines; v++) {
            if(v> 0 && v % 10 == 0) {
              clr = $scope.majorLineColor;
            }
            else {
              clr = $scope.minorLineColor;
            }
            
            ctx.beginPath();
            ctx.moveTo(x, 0);
            ctx.lineTo(x, h);
            ctx.strokeStyle = clr;
            ctx.stroke();
            x += spacing;
          }
          
          //draw the horizontal lines
          for(var h = 0; h < hLines; h++) {
            if(h > 0 && h % 10 == 0) {
              clr = $scope.majorLineColor;
            }
            else {
              clr = $scope.minorLineColor;
            }
            
            ctx.beginPath();
            ctx.moveTo(0, y);
            ctx.lineTo(w, y);
            ctx.strokeStyle = clr;
            ctx.stroke();
            y += spacing;
          }

          //draw the center

          if($scope.drawCenter) {
            clr = $scope.centerLineColor;
            ctx.strokeStyle = clr;
            ctx.beginPath();
            ctx.moveTo(center.x+.5, center.y-10);
            ctx.lineTo(center.x+.5, center.y+10);
            ctx.stroke();

            ctx.beginPath();
            ctx.moveTo(center.x-10, center.y+.5);
            ctx.lineTo(center.x+10, center.y+.5);
            ctx.stroke();
          }
        }
      }
    }
  }
});